INSERT INTO `product` VALUES (1,2,'Polo Ice Cooling','Thành phần: 85% Polyamide + 15% Spandex | Vải được xử lý hoàn thiện tính năng Thấm hút (Wicking) và Nhanh khô (Ex-Dry) | Đường lai tay và lai áo cắt laser được ép seam hiện đại | Kiểu dệt Pique thoáng khí, mang đến cảm giác mát mẻ khi mặc | Vải có độ bền cao, hạn chế co rút và chống nhăn tốt | Tự hào sản xuất tại Việt Nam |',350000,'350.000 ₫'),(2,3,'Quần dài Kaki Excool','Thành phần: 50% Polyester + 50% sợi Sorona | Sợi Sorona tự nhiên thoáng khí, mát mẻ | Vải được xử lí tính năng trượt nước | Co giãn nhẹ, thoải mái | Form dáng: Slim fit, ôm vừa vặn | Xem thêm về sợi Sorona tại đây > | Hiệu quả tính năng trượt nước giảm dần sau mỗi lần giặt | Tự hào sản xuất tại Việt Nam | ',449000,'449.000đ'),(3,3,'Quần dài thể thao Pro Active','Thành phần: 100% Polyester | Chất liệu quần dài thể thao có khả năng giữ ấm | Hạn chế xù lông và chống nhăn | Form quần: Regular, ôm nhẹ | Tự hào sản xuất tại Việt Nam | Người mẫu: 1m77 - 69kg, mặc quần size XL | ',379000,'379.000đ'),(4,2,'Áo khoác thể thao Pro Active','Thành phần: 100% Polyester | Chất liệu áo khoác thể thao có khả năng giữ ấm | Hạn chế xù lông và chống nhăn | Form áo: Regular, ôm nhẹ | Tự hào sản xuất tại Việt Nam | Người mẫu: 1m77 - 69kg, mặc áo 2XL | ',469000,'469.000đ'),(5,3,'Quần Joggers Daily Wear','Chất liệu: 100% Polyester | Công nghệ ứng dụng: Quần jogger nam Daily Wear ứng dụng HeiQ ViroBlock giúp ức chế và tiêu diệt vi khuẩn trên bề mặt vải | Quần jogger thể thao hoàn thiện tính năng trượt nước và chống UV 99% | Tính năng kháng nước của vải hiệu quả lên đến 30 lần giặt | Tự hào sản xuất tại Việt Nam | Người mẫu: 1m77 - 69kg, mặc quần size XL | ',279000,'279.000đ'),(6,3,'Quần nỉ Jogger Essential','Chất liệu: Nỉ chân cua | Thành phần: 62% Cotton + 38% Polyester | Định lượng vải: 360gsm dày dặn, giữ ấm cơ thể | Vải hạn chế nhăn, dễ chăm sóc | Form: Regular, ôm nhẹ | Tự hào sản xuất tại Việt Nam | Người mẫu: 1m77 - 69kg, mặc quần size XL | ',369000,'369.000đ'),(